import React from 'react';

function Footer() {
  return (
    <div className='footer'>
      <div>
      </div>
      <div>
        <div className='footer_text' >
          Made by{' '}
          <a href="https://github.com/dmytrodemianchuk" rel="noreferrer" target={'_blank'}>
            Dmytro Demianchuk
          </a>
        </div>
      </div>
    </div>
  );
}

export default Footer;
